## S U B S ##
sub sireline {
    my @res = ();
    foreach $tier (@_) {
	if ( $opt_s ) {
	    if ($tree{$tier}[1] ne $us and $tree{$tier}[1]) {
		if (  $opt_b and grep ( /^$tier$/, @baseani )  ) {
		    last;
		}
		push @res, $tree{$tier}[1];
		push @{$mypath2{ $nowani }}, $tree{$tier}[1];
	    }
	} elsif ( $opt_d ) {
	    if ($tree{$tier}[2] ne $ud and $tree{$tier}[2] ) {
		if (  $opt_b and grep ( /^$tier$/, @baseani )  ) {
		    last;
		}
		push @res, $tree{$tier}[2];
		push @{$mypath2{ $nowani }}, $tree{$tier}[2];
	    }
	}
    }
    return @res;
}

sub complete { # completing %tree
  foreach $k (keys %tree) {
    if (!exists $tree{$tree{$k}[1]}) {
      $tree{$tree{$k}[1]}[0]=0;
      $tree{$tree{$k}[1]}[1]=$us;
      $tree{$tree{$k}[1]}[2]=$ud;
      if($v){print STDERR "-V- unknown dad $k -> *$tree{$k}[1]*\n";}
    }
    if (!exists $tree{$tree{$k}[2]}) {
      $tree{$tree{$k}[2]}[0]=0;
      $tree{$tree{$k}[2]}[1]=$us;
      $tree{$tree{$k}[2]}[2]=$ud;
      if($v){print STDERR "-V- unknown mom $k -> *$tree{$k}[2]*\n";}
    }
  }
}

sub mychomp {
   return unless @_;
   if ( $_[0] ) {
       local ($/) = ( $_[0] =~ /(\015?\012|\015)\z/ );
       chomp @_;
   }
}

